exports=async function(a,b){const{parseInfo:c}=await require("transcode/parse_info"),d=`https://wap.txtxs.org/${a.idPrefix()}_${a}/`;return c("txt\u5C0F\u8BF4",d,[/src="(?<cover>[^"]*)"[^>]*><\/td>\s*<td valign="top" class="info">\s*<p>(?:<strong>)?(?<name>[^<]+)(?:<\/strong>)?<\/p>\s*<p>作者：<a[^>]*>(?<author>[^<]+)</,/状态：(?<serial>[^<]+)</,/class="intro"><p>(?<intro>[^<]+)</],{clientOptions:{...(b&&b.clientOptions)}})};